/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER eleve_matricule_trigger
AFTER UPDATE ON eleve
FOR EACH ROW
BEGIN
    if (NEW.matricule != OLD.matricule) then
        UPDATE inscrit 
        SET matricule = NEW.matricule 
        WHERE matricule = OLD.matricule;
        update note 
        set matricule = NEW.matricule 
        where matricule = OLD.matricule;
    end if;
END */;;
